import React from 'react';
import ReactDOM from 'react-dom/client';
import { PagesContextProvider } from './contexts/PagesContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PagesContextProvider>
      <App />
    </PagesContextProvider>
  </React.StrictMode>
);
